import React, { Component } from "react";
import { Col } from "antd";

export class About extends Component {
  render() {
    return (
      <Col span={8}>
        <div
          style={{
            color: "white",
            fontWeight: "bold",
            fontSize: "25px",
            marginLeft: "30px",
            marginTop: "100px",
          }}
        >
          Name
        </div>
        <div style={{ color: "white", marginLeft: "30px" }}>
          Choi Jong Sun(최종선)
        </div>
        <div
          style={{
            color: "white",
            fontWeight: "bold",
            fontSize: "25px",
            marginLeft: "30px"
          }}
        >
          Age
        </div>
        <div style={{ color: "white", marginLeft: "30px" }}>28</div>
        <div
          style={{
            color: "white",
            fontWeight: "bold",
            fontSize: "25px",
            marginLeft: "30px"
          }}
        >
          Date of Birth
        </div>
        <div style={{ color: "white", marginLeft: "30px" }}>1992.03.29</div>
        <div
          style={{
            color: "white",
            fontWeight: "bold",
            fontSize: "25px",
            marginLeft: "30px"
          }}
        >
          Nationality
        </div>
        <div style={{ color: "white", marginLeft: "30px" }}>Korea</div>
      </Col>
    );
  }
}

export default About;
